static void truncate_table_bits(Uint64 *counts, double *probs, int old_bits, int new_bits) {
	int ns = 1 << new_bits;
	int os = 1 << old_bits;
	for (int i = ns; i < os; i++) {
		int ni = i & (ns-1);
		counts[ni] += counts[i];
		counts[i] = 0;
		probs[ni] += probs[i];
		probs[i] = 0;
	}
}
