void PractRand::Tests::FPF::get_results(std::vector<TestResult> &results) {
	unsigned long max_exp = (1 << exp_bits) - 1;
	if (max_exp - 1 + sig_bits > 64) max_exp = 64 + 1 - sig_bits;
	unsigned long max_sig = (1 << sig_bits) - 1;
	unsigned long footprint = sig_bits + max_exp;
	unsigned long stride_bits = 1 << stride_bits_L2;

	int total_size = (max_sig + 1) * (max_exp + 1);
	double samples = (blocks_tested * TestBlock::SIZE * 8.0 + 1 - footprint) / stride_bits;
	double adjusted_samples = samples;
/*	if (stride_bits == 16) adjusted_samples *= 0.99;
	if (stride_bits == 8) adjusted_samples =  0.95;
	if (stride_bits == 4) adjusted_samples = samples * 0.9;
	if (stride_bits == 2) adjusted_samples = samples * 0.8;
	if (stride_bits == 1) adjusted_samples = samples * 0.6;*/

	std::vector<double> probs; probs.resize(total_size);
	const Uint64 *counts_ = counts.get_array();
	std::vector<Uint64> counts2; counts2.resize(total_size);
	double actual_samples = 0;
	for (int i = 0; i < total_size; i++) {
		counts2[i] = counts_[i];
		actual_samples += counts_[i];
	}
	unsigned int usable_exp = max_exp;
	for (unsigned int fe = 0; fe <= max_exp; fe++) {
		int lossL2 = fe;
		if (fe == max_exp) lossL2 = fe-1;
		double p = pow(.5, sig_bits + lossL2 + 1.);
		double subcount = 0;
		for (unsigned int i = 0; i <= max_sig; i++) {
			int index = (fe << sig_bits) + i;
			probs[index] = p;
			subcount += counts2[index];
		}
		double expected = p * pow(2.0,(double)sig_bits) * samples;
		if (subcount < 40 && usable_exp > fe) usable_exp = fe;
	}

	total_size = (max_sig + 1) * (usable_exp + 1);
	double thresh = std::sqrt(samples*256.0); //5 + std::pow(footprint * 2.0 / stride_bits, 1.0);
	if (thresh > 16384) thresh = std::sqrt(16384 * thresh);
	int reduced_size = simplify_prob_table(total_size, samples / thresh, &probs[0], &counts2[0], true, false);
	double r = g_test(reduced_size, &probs[0], &counts2[0]);
	double p = math_chisquared_to_pvalue(r, reduced_size-1);
	r = math_chisquared_to_normal(r, reduced_size-1);
	//p = math_normaldist_to_pvalue(r);

	//only the crudest of generalities at first
	if (samples <= 2000) {
		results.push_back(TestResult(get_name(), r, 0, TestResult::TYPE_RAW, .01));
	}
	else if (samples <= 4096) {
		results.push_back(TestResult(get_name(), r, (r <= 5) || (r >= 180), TestResult::TYPE_PASSFAIL, .25));
	}
	else if (samples <= 16384) {
		results.push_back(TestResult(get_name(), r, (r <= 0) || (r >= 150), TestResult::TYPE_PASSFAIL, .25));
	}
	else if (samples <= 256 * 1024) {
		results.push_back(TestResult(get_name(), r, (r <= -3) || (r >= 80), TestResult::TYPE_PASSFAIL, .25));
	}
	else if (samples <= 1024 * 1024) {
		results.push_back(TestResult(get_name(), r, (r <= -10) || (r >= 60), TestResult::TYPE_PASSFAIL, .25));
	}
	else if (samples <= 32 * 1024 * 1024) {
		results.push_back(TestResult(get_name(), r, (r <= -15) || (r >= 35), TestResult::TYPE_PASSFAIL, .25));
	}
	else {//now we can use more or less real p-values, though they aren't great
		TestCalibrationData *calib = calibration_manager.get_calibration_data("FPF-14+6/8", samples/1024.0);
		double suspicion = calib->sample_to_suspicion(r) * -1;//negation to make the normal failure type occur at 0 instead of 1
		results.push_back(TestResult(get_name(), r, suspicion, TestResult::TYPE_GOOD_S, .75));
	}
}
void PractRand::Tests::FPF::test_blocks(TestBlock *data, int numblocks) {
	unsigned long max_exp = (1 << exp_bits) - 1;
	if (max_exp - 1 + sig_bits > 64) max_exp = 64 + 1 - sig_bits;
	unsigned long max_sig = (1 << sig_bits) - 1;
	unsigned long footprint = sig_bits + max_exp;
	unsigned long stride_bits = 1 << stride_bits_L2;

	if (max_exp + sig_bits - 1 <= 32) {
		if (stride_bits >= 32) {//small footprint, long stride
			long stride32 = 1 << (stride_bits_L2 - 5);
			long max = numblocks * (TestBlock::SIZE / 4);
			for (long i = 0; i < max; i += stride32) {
				Uint32 cur = data->as32[i];
				unsigned long e = count_low_zeroes32(cur);
				unsigned long sig;
				if (e >= max_exp) {
					e = max_exp;
					sig = (cur >> e) & max_sig;
				}
				else {
					sig = (cur >> (e+1)) & max_sig;
				}
				unsigned long index = (e << sig_bits) + sig;
				counts.increment(index);
			}
		}
		else {//small footprint, short stride
			long max32 = numblocks * (TestBlock::SIZE / 4);
			Uint32 cur;
			long start;
			if (blocks_tested) {
				cur = reverse_bits32(data->as32[-1]);
				start = 0;
			}
			else {
				cur = reverse_bits32(data->as32[0]);
				start = 1;
			}
			unsigned long word_parts = 32 >> stride_bits_L2;
			for (long i = start; i < max32; i += 1) {
				Uint32 word = data->as32[i];
				for (unsigned long sub_word = 0; sub_word < word_parts; sub_word++) {
					for (unsigned long j = 0; j < stride_bits; j++) {
						cur = (cur << 1) | (word & 1);
						word >>= 1;
					}
					unsigned long e = count_low_zeroes32(cur);
					unsigned long sig;
					if (e >= max_exp) {
						e = max_exp;
						sig = (cur >> e) & max_sig;
					}
					else {
						sig = (cur >> (e+1)) & max_sig;
					}
					unsigned long index = (e << sig_bits) + sig;
					counts.increment(index);
				}
			}
		}
	}
	else {
		if (stride_bits >= 32) {//large footprint, long stride
			long stride32 = 1 << (stride_bits_L2 - 5);
			long max = numblocks * (TestBlock::SIZE / 4) - 1;
			for (long i = blocks_tested ? -1 : 0; i < max; i += stride32) {
				Uint32 cur = data->as32[i];
				unsigned long e = count_low_zeroes32(cur);
				unsigned long sig;
				if (e < 32 - sig_bits) {
					sig = (cur >> (e+1)) & max_sig;
				}
				else {
					Uint64 cur2 = cur | (Uint64(reverse_bits32(data->as32[i+1])) << 32);
					if (e < max_exp) {
						sig = Uint32(cur2 >> (e+1)) & max_sig;
					}
					else {
						e = max_exp;
						sig = Uint32(cur2 >> e) & max_sig;
					}
				}
				unsigned long index = (e << sig_bits) + sig;
				counts.increment(index);
			}
		}
		else {//large footprint, short stride
			long max32 = numblocks * (TestBlock::SIZE / 4) - 1;
			long start;
			Uint32 cur;
			if (blocks_tested) {
				cur = reverse_bits32(data->as32[-2]);
				start = -1;
			}
			else {
				cur = reverse_bits32(data->as32[0]);
				start = 1;
			}
			unsigned long word_parts = 32 >> stride_bits_L2;
			for (long i = start; i < max32; i += 1) {
				Uint32 word = data->as32[i];
				for (unsigned long sub_word = 0; sub_word < word_parts; sub_word++) {
					for (unsigned long j = 0; j < stride_bits; j++) {
						cur = (cur << 1) | (word & 1);
						word >>= 1;
					}
					unsigned long e = count_low_zeroes32(cur);
					unsigned long sig;
					if (e < 32 - sig_bits) {
						sig = (cur >> (e+1)) & max_sig;
					}
					else {
						Uint64 cur2 = cur | (Uint64(reverse_bits32(data->as32[i+1])) << 32);
						if (e < max_exp) {
							sig = Uint32(cur2 >> (e+1)) & max_sig;
						}
						else {
							e = max_exp;
							sig = Uint32(cur2 >> e) & max_sig;
						}
					}
					unsigned long index = (e << sig_bits) + sig;
					counts.increment(index);
				}
			}
		}
	}
	blocks_tested += numblocks;
}


